import React, { Component } from "react";
import News from "../News/News";
import { Consumer } from "../../context";

export default class HoWorldPageme extends Component {
  render() {
    return (
      <Consumer>
        {(value) => {
          console.log(value.tabChange);
          return (
            <React.Fragment>
              <News />
            </React.Fragment>
          );
        }}
      </Consumer>
    );
  }
}
